//==API FUNCTION==//
function isOnDay(day, month) {
    var t = new Date();
    return t.getDate() == day && t.getMonth() + 1 == month;
}

//==API FUNCTION==//
function getPonyType() {
    return docCookies.hasItem("interactive_pony_type") ? parseInt(docCookies.getItem("interactive_pony_type")) : 0;
}

function setPonyType(val) {
    GlobalPonyType = val;
    setDocCookie("interactive_pony_type", val);
}

function placeHolder() {
    return new DummyPony('~coming soon~');
}

function alias(name, pony) {
    pony.Name = name;
    return pony;
}

function sleepless(pony) {
    pony.Sleepless = true;
    return pony;
}

function attachEvents(pony, eventObject) {
    eventObject.Trigger = function (interactivePony, e) {
        if (this[e.type] != null) {
            this[e.type].apply(interactivePony, [e]);
        }
    }
    pony.Events = eventObject;
    return pony;
}

function DummyPony(name) {
    this.Name = name;
    this.getSay = function(a) {return a;};
    this.getSprite = function(elem, face, base, url) {return base + url;};
    this.getAccess = function() { return ''; };
    this.cssImages = function(elem, face) { elem.find('img.interactive_pony').css('transform', '');}; 
}

function SpecialPony(name, key, level, sayings, args) {
    if (args == null) {
        args = {};
    } else {
        for (var i in args) {
            if (typeof args[i] == 'string') {
                args[i] = args[i].split(';');
            }
        }
    }
    
    var parent = new Pony(name, key, sayings, args);
    var Active = -1;
    var next_active_timer = 10;
    var Specials = [];
    var SpecialAccess = [];
    for (var i = 0; i < level; i++) {
        Specials[i] = {
            'cloud_sleep_right.gif': gPGif(key, 'sleep' + (i + 1)),
            'dashing_right.gif': gPGif(key, 'dash' + (i + 1)),
            'trotcycle_rainbow_right.gif': gPGif(key, 'trot' + (i + 1)),
            'stand_rainbow_right.gif': gPGif(key, 'stand' + (i + 1)),
            'fly_rainbow_right.gif': gPGif(key, 'fly' + (i + 1))
        }
        SpecialAccess[i] = {
            'cloud_sleep_right.gif': gPGif(key, 'sleep_ac' + (i + 1)),
            'dashing_right.gif': gPGif(key, 'dash_ac' + (i + 1)),
            'trotcycle_rainbow_right.gif': gPGif(key, 'trot_ac' + (i + 1)),
            'stand_rainbow_right.gif': gPGif(key, 'stand_ac' + (i + 1)),
            'fly_rainbow_right.gif': gPGif(key, 'fly_ac' + (i + 1))
        }
    }
    
    this.Name = name;
    this.getSay = function(a) {
        if (Active > -1 && args[Active + 1] != null) {
            return pickOne(args[Active + 1]);
        }
        return parent.getSay(a);
    }
    this.getSprite = function(elem, face, base, url) {
        next_active_timer = (next_active_timer + 1) % 11;
        if (next_active_timer == 0) Active = Math.floor(Math.random() * (Specials.length + 1)) - 1;
        if (face == 'left') {
            url = url.replace('left', 'right');
        }
        
        var result = null;
        for (var looked = Active; looked > -1; looked--) {
            result = Specials[looked][url];
            if (result != null) {
                return result;
            } else {
                result = Specials[looked][url.replace('fly', 'trotcycle')];
                if (result != null) return result;
            }
        }
        return parent.getSprite(elem, face, base, url);
    }
    this.getAccess = function(elem, face, base, url) {
        if (face == 'left') {
            url = url.replace('left', 'right');
        }
        
        var result = null;
        for (var looked = Active; looked > -1; looked--) {
            result = SpecialAccess[looked][url];
            if (result != null) {
                return result;
            } else {
                result = SpecialAccess[looked][url.replace('fly', 'trotcycle')];
                if (result != null) return result;
            }
        }
        return parent.getAccess(elem, face, base, url);
    }
    this.cssImages = function(elem, face, url) {
        parent.cssImages(elem, face, url);
        
        for (var looked = Active + 1; looked > 0; looked--) {
            var effect = args['effect' + looked];
            if (effect != undefined) {
                $(effect[0]).css(effect[1], effect[2]);
                elem.attr('data_target', effect[0]);
                elem.attr('data_label', effect[1]);
            }
        }
        if (args.effect != undefined && (args.effect.level == undefined || args.effect.level == Active + 1)) {
            $(args.effect.target).css(args.effect.label, args.effect.value);
            elem.attr('data_target', args.effect.target);
            elem.attr('data_label', args.effect.label);
        } else {
            var anim_target = elem.attr('data_target');
            if (anim_target != null && anim_target != '') {
                $(anim_target).css(elem.attr('data_label'), '');
            }
        }
    }
}

function Pony(name, key, sayings, args) {
    if (args == null) {
        args = {};
    }
    sayings = sayings.split(';');
    var Images = {
        'cloud_sleep_right.gif': gPGif(key, 'sleep'),
        'dashing_right.gif': gPGif(key, 'dash'),
        'trotcycle_rainbow_right.gif': gPGif(key, 'trot'),
        'stand_rainbow_right.gif': gPGif(key, 'stand'),
        'fly_rainbow_right.gif': gPGif(key, 'fly')
    };
    var Accessories = {
        'cloud_sleep_right.gif': gPGif(key, 'sleep_ac'),
        'dashing_right.gif': gPGif(key, 'dash_ac'),
        'trotcycle_rainbow_right.gif': gPGif(key, 'trot_ac'),
        'stand_rainbow_right.gif': gPGif(key, 'stand_ac'),
        'fly_rainbow_right.gif': gPGif(key, 'fly_ac')
    };
    this.Name = name;
    this.Grounded = Images['fly_rainbow_right.gif'] == null;
    this.getSay = function(a) {return pickOne(sayings);}
    this.getSprite = function(elem, face, base, url) {
        if (face == 'left') {
            url = url.replace('left', 'right');
        }
        return Images[this.Grounded ? url.replace('fly', 'trotcycle') : url];
    }
    this.getAccess = function(elem, face, base, url) {
        if (face == 'left') {
            url = url.replace('left', 'right');
        }
        return Accessories[this.Grounded ? url.replace('fly', 'trotcycle') : url];
    }
    this.cssImages = function(elem, face) {
        if (face == 'left') {
            elem.find('img.interactive_pony').css('transform', 'scaleX(-1)');
            elem.find('img.interactive_pony_accessory').css('transform', 'scaleX(-1)');
            elem.find('img.interactive_pony_accessory').css('left', '-30px');
            elem.find('img.interactive_pony_accessory').css('right', '');
        } else {
            elem.find('img.interactive_pony').css('transform', '');
            elem.find('img.interactive_pony_accessory').css('transform', '');
            elem.find('img.interactive_pony_accessory').css('left', '');
            elem.find('img.interactive_pony_accessory').css('right', '-30px');
        }
        if (args.effect != undefined) {
            $(args.effect.target).css(args.effect.label, args.effect.value);
            elem.attr('data_target', args.effect.target);
            elem.attr('data_label', args.effect.label);
        } else {
            var anim_target = elem.attr('data_target');
            if (anim_target != null && anim_target != '') {
                $(anim_target).css(elem.attr('data_label'), '');
            }
        }
    }
}

function setupMorePonies() {
    var interactiveP = $('input[name="show_interactive_pony"]');
    if (interactiveP.length > 0) {
        interactiveP = interactiveP.parent().parent().parent();
        var InteractivePonyType = '<select name="interactive_pony_type">';
        for (var i = 0; i < Ponies.length; i++) {
            if (Ponies[i].Name != '~coming soon~') {
               InteractivePonyType += '<option value="' + i + '">' + Ponies[i].Name + '</option>';
            }
        }
        InteractivePonyType += '</select>';
        InteractivePonyType = $(InteractivePonyType);
        var row = $('<tr><td class="label">Interactive Pony Type</td><td><div id="ponyTypeDiv" /></td></tr>');
        row.find('#ponyTypeDiv').append(InteractivePonyType);
        interactiveP.after(row);
        
        InteractivePonyType.val(GlobalPonyType);
        InteractivePonyType.change(function() {
            setPonyType(this.value);
        });
    }
    
    InteractivePony.prototype.ponyType = function () {
        return Ponies[GlobalPonyType % Ponies.length];
    };
    InteractivePony.prototype.Trigger = function (e) {
        var pone = this.ponyType();
        if (pone.Events != null) {
            pone.Events.Trigger(this, e);
        }
    };
    InteractivePony.prototype.Say = function (a) {
        var pone = this.ponyType();
        this.text = (pone.Sleepless == true || this.forceSleep != true && this.state != 'sleeping') ? pone.getSay(a) : 'zzz...';
        this.next_text_timer = this.text_counter = 0;
        this.dom_element.find('div.speech').fadeIn();
    };
    InteractivePony.prototype.Speak = function (a) {
        this.text = pickOne(a.split(';'));
        this.next_text_timer = this.text_counter = 0;
        this.dom_element.find('div.speech').fadeIn();
    };
    InteractivePony.prototype.Clicked = function() {
        this.state = this.state == 'sleeping' ? 'default' : 'sleeping';
        this.forceSleep = this.state == 'sleeping';
        this.SetSprite('cloud_sleep_right.gif');
        this.Trigger('click');
    };
    InteractivePony.prototype.SetSprite = function (a) {
        var pone = this.ponyType();
        pone.cssImages(this.dom_element, this.facing);
        var access = pone.getAccess(this.dom_element, this.facing, this.base_url, a);
        
        this.dom_element.find('img.interactive_pony_accessory').attr('src', access);
        this.dom_element.find('img.interactive_pony_accessory').css('display', access == '' ? 'none' : '');
        this.sprite != a && (this.sprite = a, this.dom_element.find('img.interactive_pony').attr('src', pone.getSprite(this.dom_element, this.facing, this.base_url, a)))
    };
    InteractivePony.prototype.Ticks = 0;
    InteractivePony.prototype._Render = InteractivePony.prototype.Render;
    InteractivePony.prototype.Render = function() {
        if (this.dom_element.find('img.interactive_pony_accessory').length == 0) {
            this.dom_element.find('img.interactive_pony').after('<img class="interactive_pony_accessory" style="position:absolute;bottom:0px;" />');
            this.dom_element.find('img.interactive_pony').add('img.interactive_pony_accessory').css('user-select', 'none');
            this.dom_element.find('img.interactive_pony').add('img.interactive_pony_accessory').css('pointer-events', 'none');
            
            var me = this;
            $(this.dom_element).on('mousedown mouseenter mouseleave mousemove mouseover mouseout mouseup dblclick hover', function (e) {
                me.Trigger(e);
            });
            $('body').on('keydown keypress keyup', function (e) {
                me.Trigger(e);
            });
        }
        if (this.forceSleep != true) {
            this._Render();
        } else {
            this.dom_element.find('div.speech').text(this.text.substr(0, parseInt(this.text_counter)));
        }
        this.Trigger({ type: 'tick' });
    };
    
    $(document).ready(function () {
        if (GlobalPonyType != 0) {
            var ponyImage = $('img.interactive_pony');
            ponyImage.attr('src', Ponies[GlobalPonyType].getSprite(ponyImage, 'right', '', 'rainbow_fly_right.gif'));
        }
        
        $(window).unbind('konami');
        $(window).bind('konami', function() {
            var a = new InteractivePony();
            a.dom_element.find('div.speech').fadeOut();
            var type = Math.floor(Math.random() * Ponies.length);
            a.ponyType = function () {
                return Ponies[type];
            };
            a.Say(dash_sayings[Math.floor(Math.random() * dash_sayings.length)]);
            setInterval(function () {
                window_focused && (a.Update(0.016), a.Render())
            }, 16);
        });
    });
    
    makeStyle('\
       .interactive_pony .speech_container {\
              pointer-events: none;}\
        @keyframes wub {\
            0% {transform: scale(1,1);}\
            10% {transform: scale(1.00125,1.00125);}\
            20% {transform: scale(1.0125,1.0125);}\
            30% {transform: scale(1.00125,1.00125);}\
            40% {transform: scale(1.0125,1.0125);}\
            50% {transform: scale(1.00125,1.00125);}\
            60% {transform: scale(1,1);}\
            70% {transform: scale(0.99985,0.99985);}\
            80% {transform: scale(1,1);}\
            90% {transform: scale(1.0125,1.0125);}\
            100% {transform: scale(1.00125,1.00125);}}\
    ');
}

